import React from "react";
import { NavLink } from "react-router-dom";

const HeadBar = ({ headerName }) => {
  return (
    <div className="HeadBar-container">
      <div className="HeadBar-left-part">
        <img
          src={process.env.PUBLIC_URL + "/imgs/icon.png"}
          alt="logo-anouanze"
        />
      </div>
      <div className="HeadBar-right-part">
        <NavLink to="/paroisses">
          <h1>{headerName}</h1>
          <img
            src={process.env.PUBLIC_URL + "/imgs/icons/arrow-right.png"}
            alt="arrow-right"
          />
        </NavLink>
      </div>
    </div>
  );
};

export default HeadBar;
